import * as r from "react";
import t from "../lib/SSRBase.es.js";
import m from "../defs/Barn.es.js";
const o = r.forwardRef((a, e) => /* @__PURE__ */ r.createElement(t, { ref: e, ...a, weights: m }));
o.displayName = "BarnIcon";
const c = o;
export {
  c as Barn,
  o as BarnIcon
};
